# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - pydantic.BaseModel~Subclass
    - rstcheck_core
    - Member[config].Member[RstcheckConfigFile]
  - - pydantic.BaseModel~Subclass
    - rstcheck_core
    - Member[config].Member[RstcheckConfig]
  - - pydantic.BaseModel~Subclass
    - rstcheck_core
    - Member[config].Member[_RstcheckConfigINIFile]
  - - pydantic.BaseModel~Subclass
    - rstcheck_core
    - Member[config].Member[_RstcheckConfigTOMLFile]
